import logo from './katepic.jpeg';
import bg from './bg.jpg';

import './App.css';

function App() {
  return (
    <div className="App">

      <header className="App-header" styles={{ backgroundImage:bg }}>
      <img src={bg} className="App-logo" alt="logo" />

        <img src={logo} className="App-logo" alt="logo" />
        <p>
        Merry Christmas Katie!!
        </p>
      </header>
    </div>
  );
}

export default App;
